import React from "react";
import "./style.css";

function Contact(props){
    return(
      <div class = "contact">

        <h1 class="xxlarge">contact me</h1>
        <hr/>
        <div class="contactDivs">Email</div>
        <div class="contactDivs">GitHub</div>
        <div class="contactDivs">Resume (PDF)</div>
        <div class="contactDivs"><a href="https://www.linkedin.com/in/cory-quirk/" class="fa fa-linkedin"></a>
          <p>LinkedIn</p></div>
    </div>
    )
}

export default Contact;
